import './start.css';
import { Link } from 'react-router-dom';

import { Title, Button } from '../../components';


function Start() {
  return (
      <div className='start'>
        <Title/>
        <Button>Singleplayer</Button>
        <Link to="/config">
          <Button>Multiplayer</Button>
        </Link>
      </div>
  );
}

export default Start;
